import React from 'react';
import styled from 'styled-components';
import HighLigtedButton from './Components/HighLigtedButton';
import Deals from './Pages/MainHomePage/Deals';
import Mainpage from './Pages/MainHomePage/Mainpage';
import MenueSlider from './Pages/MainHomePage/MenueSlider';

const PageAndSliderConnector=styled.div`
text-align: center;
background-color: whitesmoke;
padding-top: 50px;
`;
const MenueSliderAndDealsConnector=styled.div`
text-align: center;
background-color: whitesmoke;
padding-top: 40px;
padding-bottom: 40px;
`;

function App() {
  return (
    <>
   <Mainpage/>
  <PageAndSliderConnector>
    <h1 style={{marginBottom:'0rem'}}>Check items in Menue</h1>
  </PageAndSliderConnector>
  <MenueSlider/>
  <MenueSliderAndDealsConnector>
  <h1 style={{marginBottom:'0rem'}}>Grab your Deals Now</h1>
  </MenueSliderAndDealsConnector>
  <Deals/> 
  </>
  );
}

export default App;
